package assingment.week2;

public class Swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=20;
		int b=10;
		int c;
		
	   System.out.println("Before Swaping: "+a+ " " +b);
	   
	   c=a;
	   a=b;
	   b=c;
	   System.out.println("After Swaping: "+a+ " "+b);
	   

	}

}
